import React, {useEffect, useState} from 'react';
import axios from 'axios';

function GitHub(){

    const [data, setData]= useState([]);

    useEffect(()=>{
        axios.get("https://api.chucknorris.io/jokes/value")
        .then(res=>{
            setData(res.data.value)
        });
    },[])
    return(
        <div>

        </div>
    );
}

export default GitHub
